You can install the TypeScript compiler by running the following command: pnpm add -g typescript The -g flag tells pnpm to install the package globally and not just for a particular project. Let's see how we can use the TypeScript compiler. First, create a file index.ts: type Task = { id: number; title: string; description: string;
}; function showTask(task: Task) { console.log( `Task with ID=${task.id} has the title ${task.title} and description ${task.description}`, );
} showTask({ id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}); We can't execute TypeScript files in the browser or in Node.js directly. Instead we need to first compile the TypeScript code to JavaScript - which is why we installed the compiler. Finally we can execute the resulting JavaScript code same as usual. Here is how we can compile the index.ts file: tsc --strict index.ts Note that the --strict turns on certain "strict" type checks. We will basically always do this. Since there were no type errors, nothing is logged on the console and we get a file index.js which looks (approximately) as follows: function showTask(task) { console.log( 'Task with ID=' .concat(task.id, ' has the title ') .concat(task.title, ' and description ') .concat(task.description), );
}
showTask({ id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}); Note that all the type annotations are gone and all we get is vanilla JavaScript that we can execute. Additionally the TypeScript compiler downleved our code so that it can be executed by older platforms. Here the template string syntax (which is not supported by very old browsers) was replaced by a series of concat calls. Note that by the time you're reading this the default target settings might be different and you might not see this particular downleveling anymore. What if there is an error in index.ts? type Task = { id: number; title: string; description: string;
}; function showTask(task: Task) { console.log( `Task with ID=${task.id} has the title ${task.title} and description ${task.description}`, );
} showTask({ id: 1, title: 'Read the Next.js book',
}); Now we get an error if we try to run tsc --strict index.ts: index.ts:13:10 - error TS2345: Argument of type '{ id: number; title: string; }' is not assignable to parameter of type 'Task'. Property 'description' is missing in type '{ id: number; title: string; }' but required in type 'Task'.
13 showTask({ ~
14 id: 1, ~~~~~~~~
15 title: 'Read the Next.js book', ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~
16 }); ~ index.ts:4:3 4 description: string; ~~~~~~~~~~~ 'description' is declared here.
Found 1 error in index.ts:13 The compiler correctly informed us that if we were to run this code it would probably result in bad things happening due to the missing description property. We now know that the code is probably wrong long before it made it anywhere near production and can fix it accordingly.

