The primitive types that are present in TypeScript should already be familiar to you from the chapter on JavaScript. TypeScript has the number type: const id: number = 1; TypeScript also has the string type: const task: string = 'Read the Next.js book'; It also has the boolean type: const inProgress: boolean = true; Additionally TypeScript has the null and undefined types: const undefinedTask: undefined = undefined;
const nullTask: null = null; Remember that in a real codebase we would let TypeScript infer the variables: const id = 1;
const task = 'Read the Next.js book';
const inProgress = true;
const undefinedTask = undefined;
const nullTask = null; In this example, TypeScript will infer that id has the type number, task has the type string, inProgress has the type boolean, undefinedTask has the type undefined and that nullTask has the type null.

105.body:
TypeScript also has the any type. When a value is of the type any, you can access its properties, call it, or assign it freely, and basically do any thing (get it?) that's syntactically correct. Also note that any property that you access will in turn have the type any. Let's say you have a task variable of type any - then these are all legal: let task: any; console.log(task.title);
task();
task.thingy(); Basically using any is a way to tell the compiler to "shut up" and skip type checking altogether. This is also the reason why using any is generally a terrible idea since it defeats the purpose of using TypeScript in the first place! However sometimes you do find yourself in a situation where you really don't know much or don't particularly care about a variable type. In this case it's better to use the unknown type. Anything is assignable to unknown (just as with any), however no operations are allowed on an unknown variable without further assurances about the type of the variable. For example, if you have a task variable of type unknown, then these are all no longer legal: let task: unknown; console.log(task.title);
task();
task.thingy();

