You can type an object by writing the property keys and types of its properties inside curly braces {}. For example here is how you could declare an object that has the properties id of type number, title of type string and description of type string: const task: { id: number; title: string; description: string } = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}; As usual, you don't need to manually specify object types. In this example, task will be inferred to have the type { id: number; title: string; description: string }: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}; You can mark properties as optional by using the question mark ?. If a property is marked as optional, you can assign undefined to it or even not specify it altogether. For example, this is valid: const task: { id: number; title: string; description?: string } = { id: 1, title: 'Read the Next.js book',
}; const task2: { id: number; title: string; description?: string } = { id: 1, title: 'Read the Next.js book', description: undefined,
};

