The object type syntax we just introduced is often quite verbose. This is why TypeScript gives you the possibility to specify a type alias (i.e. another name) for an object type: type Task = { id: number; title: string; description: string;
}; Note that you can specify type aliases for more than just object types since type aliases are basically just different names for types. For example, we could specify a type alias for the primitive type string: type ID = string; Another important point to make about type aliases is that two type aliases are exactly the same as long as the underlying types are the same. For example this is valid even though it doesn't look like it: type MyString = string; function getMyString(): MyString { return 'My string';
} const s: string = getMyString(); This is because TypeScript uses a structural type system - it doesn't matter what the types are named (except for the primitive types of course), it only matters what their structure looks like. Note that you can also use the interface keyword to achieve a similar effect: interface Task { id: number; title: string; description: string;
} We will stick to always using type. The interface keyword is out of scope for this book and will not be discussed further. We briefly note that type and interface are not exactly the same and have a few subtle, but important differences. Again, we will not discuss this further.

111.body:
We can annotate functions in TypeScript by annotating their parameters. Consider a function greet that takes a parameter name of type string and simply outputs a greeting to the console. Here is how we would annotate the function: function greet(name: string) { console.log(`Hello, ${name}`);
} Now arguments to the function are checked: greet(false);
// This will result in a type error You can annotate functions that expect arrays and/or objects by simply using the syntax you learned in the previous section: function showTask(task: { id: number; summary: string; description: string }) { console.log( `Task with ID=${task.id} has the summary ${task.summary} and description ${task.description}`, );
} This is not particularly readable. Luckily, this is where type aliases come in really handy: type Task = { id: number; summary: string; description: string;
}; function showTask(task: Task) { console.log( `Task with ID=${task.id} has the summary ${task.summary} and description ${task.description}`, );
} Note that TypeScript will not just check that the passed arguments have the correct types, but also check that the correct number of arguments was passed. This has an interesting side effect - introducing the TypeScript compiler in a JavaScript codebase can reveal bugs without any further work: function showTask(task) { console.log( `Task with ID=${task.id} has the summary ${task.summary} and description ${task.description}`, );
} // Uh-oh, we are passing multiple variables instead of a single object!
showTask(1, 'Read the Next.js book', 'Read and understand the Next.js book.'); If we run tsc --strict on this code, we will get the following error: index.ts:8:13 - error TS2554: Expected 1 arguments, but got 3. 8 showTask(1, 'Read the Next.js book', 'Read and understand the Next.js book.'); TypeScript is quite useful indeed!

