We can also annotate the return types of our functions: function getGreeting(name: string): string { return `Hello, ${name}`;
} Note that you usually don't need a return type annotation because TypeScript can do type inference for them: function getGreeting(name: string) { return `Hello, ${name}`;
} Nevertheless, return types are often typed explicitly to avoid accidentally returning a type you didn't want to return or to prevent accidental changes to the return type.

113.body:
Similar to object properties, function parameters can be marked as optional . In this case we can, but don't need to pass the corresponding argument to the function. If a parameter is marked as optional, the corresponding argument might also be undefined: function getGreeting(name: string, message?: string): string { return `${message !== undefined ? message : 'Hello'}, ${name}`;
} // These are all valid
getGreeting('John Doe');
getGreeting('John Doe', undefined);
getGreeting('John Doe', 'Welcome');

