Sometimes you need to create a type that specifies the function itself, instead of just its parameters or its return type. For example, you might want to say that f is a function that takes two strings and returns a string. You can achieve this with a function type expression : let f: (x: string, y: string) => string; The parameter names are required here, if you write (string, string) => string then TypeScript will think that you have a function with two parameters named string of type any. This syntax is very useful for typing higher-order functions: function getGreeting(name: string, greeter: (name: string) => string) { return greeter(name);
} const myName = 'John Doe';
const greeter = (name: string) => `Hello ${name}`; console.log(getGreeting(myName, greeter)); One interesting consequence of the way TypeScript inference works, is that parameters of functions can often be inferred. Let's change this example and make an anonymous function out of greeter: function getGreeting(name: string, greeter: (name: string) => string) { return greeter(name);
} const myName = 'John Doe'; console.log(getGreeting(myName, (name) => `Hello ${name}`)); Note how we no longer need to explicitly specify the type of name in the anonymous function - TypeScript has automatically inferred it to be of type string.

116.body:
A literal type is a type whose only value is a literal. Here is how we could define a literal type 'Todo': type TodoType = 'Todo'; Here is how we can use it: let todo: TodoType = 'Todo'; Note that we can't assign any other value to todo including other strings. For example this is not possible: let todo: TodoType = 'Done';
// This will result in a type error We could also skip declaring the type alias and just use the literal type directly: let todo: 'Todo' = 'Todo'; It should be noted that if we declare a variable, then by default TypeScript will infer it as a string. This makes sense since we could change the variable later: let todo = 'Todo';
// Without the explicit type annotation, todo is a string However if we declare a constant, then by default TypeScript will infer a literal type. This also makes sense since we can't change the constant later: const todo = 'Todo';
// Even without the explicit type annotation,
// todo now has the literal type 'Todo' While literal types by themselves are not very helpful, they are extremely useful in the context of union types.

117.body:
A union type is a type that represents a value which may be one of multiple values. Consider a type TaskState which represents one of the following states: Todo InProgress Done Here is how we would define the TaskState type: type TaskState = 'Todo' | 'InProgress' | 'Done'; The TaskState type is a union type and each of the literal types 'Todo', 'InProgress' and 'Done' is a member of the union. A variable of type TaskState can only be of one of these literal types, i.e. it can only have one of the respective values. For example these are all valid: const state: TaskState = 'Todo';
const state2: TaskState = 'InProgress';
const state3: TaskState = 'Done'; But this is not: const invalidState: TaskState = 'Dropped';

119.body:
It should be clear by now how we can define a union type, but how can we work with a union type? Consider the following function: function logTaskName(taskName: string | undefined) { console.log({ taskName, taskNameLength: taskName.length, });
} Compiling this example will result in the following error: index.ts:4:21 - error TS18048: 'taskName' is possibly 'undefined'.
4 taskNameLength: taskName.length, ~~~~~~~~
Found 1 error in index.ts:4 TypeScript will only allow to do something with the value of a union type if that something is valid for every member of the union. Since taskName can be either a string or undefined, we can't access .length on it, because .length is not a valid property of undefined! Instead we need to perform type narrowing where we narrow the type of a variable with code. Basically, TypeScript can look at our code and try to understand that in certain code parts a value of a union type can only have the type of a particular member of the union. The simplest way of narrowing a type is equality narrowing . Here we can use the === or !== operators to narrow a type. Consider this example: function logTaskName(taskName: string | undefined) { if (taskName !== undefined) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} We narrow the type of taskName in the taskName !== undefined branch. TypeScript will inspect our code and realize that since taskName had the string | undefined type and taskName !== undefined in the truthy branch of the if statement, taskName must be of type string inside that branch (there is simply no other way). Similarly, in the falsy branch of the if statement (i.e. the else branch), TypeScript will know that taskName must be undefined. This example also showcases a very important concept: The same variable can have a different type depending on the part of the code we are. This is not the case in many other programming languages, where a variable will always have the same type once it has been initialized. Another (similar) way of narrowing a type is truthiness narrowing . Here we use the fact that certain values are truthy or falsy to narrow a type. Consider this example: function logTaskName(taskName: string | undefined | null) { if (taskName) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} Since undefined and null are both falsy, the taskName in the truthy branch of the if statement can only have the type string and we can use the .length property. However truthiness narrowing can lead to bugs and indeed the function logTaskName has a subtle error. Can you spot it? That's right - it doesn't correctly handle the case of the empty string - after all, the empty string '' is also falsy, therefore logTaskName("") would print that the task not defined, which is probably not what we were going for. We could fix the function like this: function logTaskName(taskName: string | undefined | null) { if (taskName === '') { console.log('the task is empty'); } else if (taskName) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} You should generally be careful when relying on truthiness or falsiness. The way these concepts work in JavaScript can be a bit confusing and it's easy to miss an edge case. Some people prefer to avoid these concepts altogether and instead provide explicit checks, for example: function logTaskName(taskName: string | undefined | null) { if (taskName !== undefined && taskName !== null) { console.log({ taskName, taskNameLength: taskName.length, }); } else { console.log('the task is not defined'); }
} The last way of narrowing a type that we will discuss here is typeof narrowing. TypeScript knows how the typeof operator works and you can use it to narrow a type as you would expect: function processInput(value: string | number): number { if (typeof value === 'string') { // value must be a string here return value.length; } else { // value must be a number here return value; }
}

121.body:
We can write user-defined type guards by utilizing type predicates . Consider the following example: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter((val) => val !== undefined); Here array is a (string | undefined)[] and filteredArray removes the undefined elements. However the inferred type of filteredArray would still be (string | undefined)[] because TypeScript can't easily inspect the contents of the filter function to realize that we remove the undefined elements. We could theoretically use a type assertion here: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter((val) => val !== undefined) as string[]; However instead of yelling at the TypeScript compiler that we know better, we can choose a better way and write a user-defined type guard: function isString(val: string | undefined): val is string { return typeof val === 'string';
} The isString function is a type guard, because it's return type is the type predicate val is string. Generally, a type predicate must have the form parameter is Type where parameter is the name of a parameter from the function signature. We can use the type guard like this: const array = ['Hello', undefined, 'World', undefined];
const filteredArray = array.filter(isString); Now the inferred type of filteredArray will be string[] - and all that without using a single type assertion. Hooray!

122.body:
A particularly important union type is the discriminated union . This is a union where a property is used to discriminate between union members. Consider the following classical example: type Square = { kind: 'square'; size: number;
}; type Rectangle = { kind: 'rectangle'; width: number; height: number;
}; type Shape = Square | Rectangle; We can now narrow values of the discriminated union based on the discriminant property (which in this case is kind): function getArea(shape: Shape) { if (shape.kind === 'square') { // Here shape must be of type Square return shape.size * shape.size; } else { // Here shape must be of type Rectangle return shape.width * shape.height; }
}

124.body:
Generics allow us to write code that is type-safe, yet independent of specific types. Consider the example of retrieving the first element of an array: function getFirstElement(arr) { return arr[0];
} How would we type this? We could use any: function getFirstElement(arr: any): any { return arr[0];
} However using any is - as we already mentioned - a bad idea since we lose all the type information even if we pass in an array of a known type. For example all these constants would be inferred to have type any: const num = getFirstElement([1, 2, 3]);
const str = getFirstElement(['a', 'b', 'c']); We also can't use the unknown type since it doesn't permit any operations: function getFirstElement(arr: unknown) { return arr[0]; // This will result in a type error
} We could also make use of function overloads and write something like this: function getFirstElement(arr: number[]): number;
function getFirstElement(arr: string[]): string;
function getFirstElement(arr: undefined[]): undefined;
// More overloads and implementation here We will not discuss function overloads in more detail as it's out of scope for this book. But this obviously gets very tedious and error-prone for most cases. Instead TypeScript allows us to use generics to specify that some code does not depend on the concrete types and only cares about the relation between certain types.

125.body:
Consider the identity function that simply takes an argument arg and returns it unchanged. We can use a type variable Type and type it like this: function identity<Type>(arg: Type): Type { return arg;
} This basically says that the identity function takes an argument of type Type and that its return type is of the same type as the argument. Now we get proper type inference: let val = 'Hello, world!';
let val2 = identity<string>(val); // val2 is of type string We dont actually have to manually specify the type string when calling the function and can instead rely the inference capabilities of TypeScript once again: let val = 'Hello, world!';
let val2 = identity(val); // val2 is of type string There is no single convention for naming type parameters. Common names include T, Type and TType. We will stick to the Type convention throughout this book. Similarly, we can type the getFirstElement function using type parameters: function getFirstElement<Type>(arr: Type[]): Type { return arr[0];
} const num = getFirstElement([1, 2, 3]);
const str = getFirstElement(['a', 'b', 'c']); Unlike in the getFirstElement example that was typed using any, we now get meaningful type inference. For example num will have the type number (instead of any) and str will have the type string. You can use any number of type parameters you want. For example here is how we could write a correctly annotated map function: function map<In, Out>(array: In[], f: (value: In) => Out): Out[] { return array.map(f);
} Here, we have two type parameters In and Out. The type parameter In indicates the types of the elements of the original array. The type parameter Out indicates the types of the elements of the result array. Note how the type of the parameter f makes uses of both the In and Out parameter types. This makes sense since f transforms an element of the original array (In) into an element of the result array (Out). Again, we will get proper type inference: const arr = map([1, 2, 3, 4], (x) => x % 2 === 0); Here arr will have the type boolean[].

126.body:
Just like with functions, we can use type parameters with objects: type Box<Type> = { content: Type;
}; Now we can use the Box type with any type: // box has the type Box<number>
const box = { content: 0,
}; // box2 has the type Box<string>
const box2 = { content: 'Hello, world!',
}; We can also use generic functions and objects together: function extractContent<Type>(box: Box<Type>): Type { return box.content;
}

127.body:
Generic object types are often useful for collections (and containers), since collection logic is often independent of the specific item types. For example, retrieving the first element of an array or finding an element of a set by value using the === operator will work the same way regardless of the types of the array or set elements. You already learned about generic arrays (note that you can use Array<T> in place of T[]). If you have an object type where the property keys have a certain known type and the property values have a certain known type, you can use the generic type Record<Key, Value> const ScoreRecord: Record<string, number> = { Alice: 50, Bob: 60, Charlie: 70,
}; Two other generic data structures that you already know about are sets and maps: const mySet: Set<number> = new Set([1, 2, 3]);
const myMap: Map<string, number> = new Map([ ['Item 1', 1], ['Item 2', 2],
]); This example can also be written like this: const mySet = new Set<number>([1, 2, 3]);
const myMap = new Map<string, number>([ ['Item 1', 1], ['Item 2', 2],
]); One other very important generic type is the Promise<Type> type which is most commonly used to annotate asynchronous functions. For example, if we have an asynchronous function f that returns a promise that will eventuell fulfill with a string, we would annotate it like this: async function f(): Promise<string> { // Implementation here
}

