We already learned how to create and run individual TypeScript files. However, as with JavaScript, we will usually be working with larger projects. Let's create a JavaScript project and add TypeScript support to it. First, we create a directory where our project will reside: mkdir example
cd example Next we need to create the package.json file to indicate that this directory should be a JavaScript project: pnpm init This will create a package.json file containing the project settings: { "name": "example", "version": "1.0.0", "description": "", "main": "index.js", "scripts": { "test": "echo \"Error: no test specified\" && exit 1" }, "keywords": [], "author": "", "license": "ISC"
} Next let's create a tsconfig.json to indicate that this particular project will use TypeScript: { "compilerOptions": { "strict": true }
} Setting the strict option in compilerOptions is equivalent to running tsc with the --strict flag. We will talk about this option in some more detail later. We could have also created the tsconfig.json file by running tsc --init, however this will add a lot of options that we really don't care about at the moment. Now let us create an index.ts file: function getGreeting(name: string): string { return `Hello, ${name}!`;
} console.log(getGreeting('World')); Finally we can compile the code: tsc This will create approximately the following index.js file: 'use strict';
function getGreeting(name) { return 'Hello, '.concat(name, '!');
}
console.log(getGreeting('World')); We can execute this file the same way we would execute any other JavaScript file: node index.js There is one small modification we need to make to this process. While using the globally installed TypeScript compiler is fine if you have a single project, you often might need to work on multiple projects at the same time. Since these projects might use different TypeScript versions, we usually want to install tsc on a per-project basis. Let's therefore install tsc as a dev (development) dependency (since we will not need it in the final code output): pnpm add --save-dev typescript This will install TypeScript only for this particular project. We can now run the tsc that was installed for this project using the following command: pnpm tsc

132.body:
Sometimes you want to include or exclude certain files from being processed by the TypeScript compiler. To accomplish this, you can specify the include or exclude parameters in the tsconfig.json. The include option takes an array of filenames or patterns to include in the program (relative to the directory containing the tsconfig.json file). For example we could include all files in src directory by setting include to ["src/**/*"]. The src/**/* notation is a so called glob pattern. Here * matches zero or more characters (excluding directory separators) and **/ matches any directory (with arbitrary nesting). Thefore src/**/* means "match any file in the directory src and all its subdirectories (no matter how deeply nested)". Note that by default include is set to ["**/*"] (i.e. match all files including arbitrarily nested subdirectories). The exclude parameter specifies an array of filenames or patterns that should be skipped when resolving include. It is important to note that the exclude parameter does not necessarily exclude the file from your codebase - a file specified by exclude can still become part of your codebase if you import it somewhere. The exclude parameter only changes which files are found by the include option finds. Consider the following example. Let's say that you have a bunch of *.test.ts files containing tests, like the following greet.test.ts: import { getGreeting } from './greet'; function testGreeting() { if (getGreeting('World') !== 'Hello, World!') { throw new Error('Test failed'); }
} This is not how we would really write a test, but that is irrelevant for now. If we would run pnpm tsc right now, we would see the we have greet.test.js in the output which is probably not desirable, since the tests probably shouldn't be part of the final compilation output. Therefore we could write the following tsconfig.json: { "include": ["src/**/*"], "exclude": ["src/**/*.test.ts"], "compilerOptions": { "strict": true, "outDir": "./dist" }
} If we delete the dist directory and run pnpm tsc again, greet.test.js is no longer present.

