} Now the tsconfig.json could extend this file: { "extends": "base.json", "include": ["src/**/*.ts"], "compilerOptions": { "noEmit": true }
} The resulting configuration would be strict and not emit JavaScript files. This feature is particularly useful because it allows someone to write a TypeScript configuration file that specifies the settings that should be applied to TypeScript codebases in a company/project and then everyone can simply extend this configuration file.

