We could use the built-in HTTP module of Node.js, but this is not terribly convenient. Instead we will use an extremely popular framework called Express . While Express builds on top of the HTTP module, it provides a lot of additional useful functionality. Create a new Node.js project inside some directory: pnpm init Install Express: pnpm add express Create a file named app.js inside the directory. In that file we will create an Express application and then make that application listen for connections on a specified host and port. This is how you can create an Express application and make it listen on port 3000: const express = require('express');
const app = express();
const PORT = 3000; app.listen(PORT, () => { console.log(`Server listening on port ${PORT}...`);
}); This application is not very useful, so let's add a route to it. Add this above the call to listen: app.get('/', (req, res) => { res.send('Hello, world!');
}); Start the application: node app.js If you open a browser and navigate to http://localhost:3000 you will see Hello, world! You can also use cURL, which includes a command-line tool for transferring data on a network. Among other things it supports HTTP and is available on pretty much every mainstream operating system out there. Open a command line and run: curl http://localhost:3000/ The will output the following: Hello, world!

147.body:
HTTP knows multiple request methods . We primarily care about two request methods for now - namely GET and POST . GET requests are generally used to retrieve data. Recall our route from above: app.get('/', (req, res) => { res.send('Hello world!');
}); This indicates that if a GET request is sent to the path '/', we would like to return 'Hello, world!' to the client. The req variable represents the request object and res represents the response object . If we want to send a HTTP response to the client we use the res.send method. POST requests are generally used to send information to the server that tell it to create a new resource or update an existing resource. For example a login request will generally be a POST request since it tells the server that a user has logged in to the application. Similarly, if you submit a web form, there will usually be a POST request attached to that, since form submissions carry new information. With POST requests, we are more interested in telling the server that something happened than in the data the server returns to us. POST requests usually need to send much more information to the server than GET requests. Therefore, POST requests can have a request body which allows us to carry this additional data when sending a request. Let's have a look at an example. Note that we need to enable some middleware (we will return to the concept of middleware later): app.use(express.text()); Consider the following route which simply returns the request body back to the client: app.post('/post-example', (req, res) => { res.send(req.body);
}); We can send a POST request via curl. We need to specify that we want to send a POST request using the -X flag. In addition we specify the data that we want to send in the body of the POST request using the -d flag. Finally we specify a header called Content-Type and set it to text/plain. This indicates that the data we want to send is plain text. The final command looks like this: curl -X POST -H "Content-Type: text/plain" -d 'haha' http://localhost:3000/post-example Generally speaking GET requests transmit information using the querystring, while POST requests transmit information in the request body. Note that we will rarely send plain text in the request. Instead we the JSON format that we introduced in the JavaScript chapter. In order to accept JSON requests, we need to replace the express.text middleware with the express.json middleware: app.use(express.json()); Now we can curl the same path like this: curl -X POST -H "Content-Type: application/json" -d '{ "key": "value" }' http://localhost:3000/post-example Note that here we specify the application/json content type.

149.body:
Responses can have status codes attached to them. These indicate the status of a request. For example, a status 400 means Bad Request, the famous status 404 means Not Found and 500 stands for Internal Server Error. Here is how you can manually return a status code in Express: app.post('/', (req, res) => { const data = req.body; // If the request body is empty, we return status code 400 (Bad Request) if (Object.keys(data).length === 0) { res.status(400).send('Bad Request: No data provided'); } else { res.status(201).send(`Received data: ${JSON.stringify(data)}`); }
}); Try to curl the endpoint both with an empty and a non-empty object. For example, you can curl the endpoint with an empty object like this: curl -X POST -H "Content-Type: application/json" -d '{}' -w '\nStatus: %{http_code}' http://localhost:3000 The output would be: Bad Request: No data provided
Status: 400 You can curl the endpoint with a non-empty object like this: curl -X POST -H "Content-Type: application/json" -d '{"key": "value"}' -w '\nStatus: %{http_code}' http://localhost:3000 The output would be: Received data: {"key":"value"}
Status: 201

150.body:
Both requests and responses can have headers which provide important information that is not part of the main request or response content. For example, request headers might contain the version of the browser that is making the request, what languages are accepted, what encodings are accepted etc. Here is how you can read request headers in Express: app.get('/request-header-example', (req, res) => { const customHeaderValue = req.get('Custom-Header'); if (customHeaderValue) { const responseData = { 'Received-Custom-Header': customHeaderValue }; res.send(`Received data: ${JSON.stringify(responseData)}`); } else { res.status(400).send('No Custom-Header provided'); }
}); You can set a header in curl like this: curl -H "Custom-Header: ExampleValue" http://localhost:3000/request-header-example You will receive the following response: Received data: {"Received-Custom-Header":"ExampleValue"} Similarly, response headers might contain the type of the content, the date of the response etc. Here is how you can set response headers in Express: app.get('/response-header-example', (req, res) => { const data = req.body; // Add a custom header res.set('X-Custom-Header', 'MyHeaderValue'); res.status(201).send(`Received data: ${JSON.stringify(data)}`);
}); You can see the response headers in curl by using the -i flag: curl -i http://localhost:3000/response-header-example This will output: HTTP/1.1 201 Created
X-Powered-By: Express
X-Custom-Header: MyHeaderValue
Content-Type: text/html; charset=utf-8
Content-Length: 17
ETag: W/"11-10nwzUtYNUZcrMxeVU7fTdmCYaI"
Date: Thu, 14 Mar 2024 11:23:03 GMT
Connection: keep-alive
Keep-Alive: timeout=5 Received data: {} Note that express already sets quite a few response headers by default. You can also see the response headers in the network tab of your browser if you click on an individual request.

