Whenever we write programs, we need to manipulate data. This data needs to be stored somewhere and we need to be able to access it somehow. We also need to deal with the fact that when we execute a program, the values we deal with are not predictable in advance. For example we don't know which tasks a user might create (that is kind of the point of writing our application). Nevertheless, we must be able to access created tasks through a predictable name like tasks or createdTasks. Therefore we need a way to put an unpredictable value somewhere and refer to it using a predictable name. In programming, that "somewhere" is referred to as storage and the predictable name as a symbolic name . A variable is just that - a storage location containing a value which is referred to by a symbolic name. This sounds really fancy, but it just means that there is a value somewhere in your storage and you can refer to that value using a symbolic name that doesn't change (even if the value itself changes). For example you could have a variable age which has the value 20 (we say that age is equal to 20): Now even if the value of age changes (e.g. to 21 because a birthday happened), the variable name doesn't change, only the value does. The variable name will still be age, however now age will have the value 21 (i.e. age will be equal to 21): JavaScript lets you declare variables with the let keyword. You can assign values to variables using the assignment operator (=): // Declare a variable
let x; // Assign a value to a variable
x = 10; You can print the value of the variable using the console.log method: console.log(x); // 10 If you follow along in the Node.js (or browser) console, you don't actually need to use the console.log method to print the value of a variable. Instead you can simply type the variable (or any expression for that matter) and the console will display its value. You can also have a declaration and an assignment on a single line. In fact, this is usually the way to go: let y = 10; The value of a variable may change over the course of a program: let y = 10;
console.log(y); // 10 // Assign a new value to the variable
y = 20;
console.log(y); // 20 This will log 10 and then 20 to the console. If you want to declare a predictable name for a value that never changes, you can declare a constant . This is done using the const keyword: const ten = 10; If you try to reassign a value to a constant, you get an error. For example if you do const ten = 10;
ten = 20; you get Uncaught TypeError: Assignment to constant variable. You will almost exclusively see us using const instead of let from now on. Reassignment is not nearly as necessary as you might think right now. You can also declare variables using the var keyword. We will not cover it here and you essentially only need to know one thing about var - you should basically never use it . It's mostly a historical artifact of the language at this point. Any variable has a data type which denotes the range of values it can take and which operations can be performed on the variable. You can use the typeof operator to obtain the data type of a variable. We begin with a few particularly important primitive data types . Let's talk about numbers, booleans, strings and undefined.

