Often we want to limit the kind of data that can be stored in a table beyond just limiting the data types. This can be accomplished with constraints . The unique constraint is used to ensure that the data in column is unique among all the rows in a table. For example, we gave the title column the unique constraint to ensure that there will never be two tasks with the same title: create table task ( -- code title text unique, -- code
); Another important constraint is the not null constraint. By default, you can insert a null value as data, where null is basically a special marker indicating that the given data doesn't exist (a bit similar to null and undefined in TypeScript). The not null constraint quite sensibly indicates that the inserted value can't be null. In our example, we want every task to have a title, a description and a status so we mark these columns as not null: create table task ( -- code title text not null, description text not null, -- code
); However, we allow a task to not have a duration and don't mark that column as not null. Basically, we apply the not null constraint if we want to ensure that a value is always present in this column. The primary key constraint means that the column should be used to identify the rows of the table. If a column is marked as primary key, its values must be unique and they can't be null. Since we want the id to uniquely identify each task, we apply the primary key constraint to the id column: create table task ( id serial primary key, -- code
); The check constraint is used to specify a condition that each row must satisfy for the value to be accepted into a column. We could have used this for the status column (by writing check in ('todo', 'inprogress', 'done')), however since we knew the values in advance, we were able to use an enum instead. Unlike enums though, check constraints allow more flexibility. For example we gave the duration column a constraint that its values must be greater than 0: create table task ( -- code duration integer check (duration > 0), -- code
); The default constraint allows us to specify a default value for a column. If an insert operation does not provide a value for a column, PostgreSQL will automatically insert the specified value. In our example, we want the created_at value to simply be the current time and use the default constraint together with current_timestamp to accomplish that: create table task ( -- code created_at timestamp default current_timestamp
);

