Finally there is one more primitive type that is of interest to us, namely undefined. There is only one value of this type: undefined. If a variable has the value undefined this (quite logically) means that it hasn't been defined. For example, whenever you have a variable that has been initialized, but not assigned to, it will automatically have the value and therefore the type undefined. let someVariable;
console.log(someVariable); // undefined
console.log(typeof someVariable); // undefined You can also manually assign the undefined value to a variable: let someVariable = undefined;
console.log(someVariable); // undefined
console.log(typeof someVariable); // undefined An important operator to know is the nullish coalescing operator ??. This operator takes two values and check if the left-hand side is undefined (or null - a value that we will not pay much attention to). If the left value is undefined or null the nullish coalescing operator evaluates the expression to the right-hand side, otherwise it returns the left-hand side: console.log(undefined ?? 1); // 1
console.log(0 ?? 1); // 0 The ?? operator is commonly used to provide useful default values. Note that string, number, boolean and undefined are not the only primitive data types. However the other primitive data types will not be relevant for this book.

