Whenever you write applications which have a lot of logic in the client, you will need to manipulate the DOM (i.e. add, remove, change or retrieve elements). This can be done by using JavaScript functions that exist on the document object, which is is a global variable that refers to the currently rendered DOM tree. For the rest of this section, we will consider the following document: <!doctype html>
<html lang="en"> <head> <meta charset="utf-8" /> <title>Easy Opus</title> </head> <body> <div id="app"> <h1>My tasks</h1> <div id="taskList"> <p id="firstParagraph" class="task"> Read the Next.js book </p> <p id="secondParagraph" class="task"> Write a website </p> </div> </div> </body>
</html> If you want to follow along, you can open this document in a browser, open the JavaScript console and then write the code in the console. First let's talk about how to retrieve elements. The document.getElementById(id) function allows you to select an element by its unique ID: const paragraph = document.getElementById('firstParagraph');
console.log(paragraph); // <p id="firstParagraph" class="task"> Note that paragraph is just a regular JavaScript object. For example, you could access various properties like the element ID and class or the HTML markup contained within the element: console.log(paragraph.id); // firstParagraph
console.log(paragraph.className); // task
console.log(paragraph.innerHTML); // Read the Next.js book We can also get all the elements that have a certain class using document.getElementsByClassName(className): const tasks = document.getElementsByClassName('task');
console.log(tasks); // HTMLCollection { 0: p#firstParagraph.task, 1: p#secondParagraph.task, length: 2, … } Note that tasks is an HTMLCollection which is an array-like object. This means that it behaves similar to an array (for example you can index it), but doesn't have most of the array methods we learned in the first chapter: console.log(tasks.length); // 2
console.log(tasks[0]); // <p id="firstParagraph" class="task"> // This will throw a TypeError: tasks.map is not a function
const ids = tasks.map((task) => task.id); You can also retrieve all elements with a certain tag by using document.getElementsByTagName(tagName). Consider this example: const paragraphs = document.getElementsByTagName('p');
console.log(paragraphs); // HTMLCollection { 0: p#firstParagraph.task, 1: p#secondParagraph.task, length: 2, … } Note how this is again an HTMLCollection. The two most important and modern JavaScript methods for element retrieval are document.querySelector(selector) and document.querySelectorAll(selector) which returns the first and all elements that match a certain CSS selector respectively. Here is how we could use these methods to accomplish our tasks from before: // The hash (#) indicates an ID selector
const paragraph = document.querySelector('#firstParagraph');
// The period (.) indicates a class selector
const tasks = document.querySelectorAll('.task');
const paragraphs = document.querySelectorAll('p'); Note that this time tasks will be a NodeList (instead of an HTMLCollection). However, a NodeList is still an array-like object that you can index with []. JavaScript also allows us to create elements and append them to other elements. You can create elements using document.createElement(tagName). This is how you could create a paragraph with an ID, a class and some text: const element = document.createElement('p');
element.id = 'thirdParagraph';
element.classList.add('task');
element.innerHTML = 'New task'; You can append an element as a last child of a parent element using parentElement.appendChild(childElement). For example to append the newly created element to another element taskList you would write this: // Retrieve the taskList element
const taskList = document.querySelector('#task-list'); // Append element to taskList
taskList.appendChild(element); Let's put all of this together and add a button to our page that allows us to add a new task. This is the JavaScript that we would like to execute if the button is clicked: const paragraph = document.createElement('p');
paragraph.id = 'thirdParagraph';
paragraph.classList.add('task');
paragraph.innerHTML = 'New task';
const taskList = document.querySelector('#task-list');
taskList.appendChild(paragraph);

