Events can be used to react to "interesting changes" like user input. For example, you might want to do something if the user clicks a button, presses a key or resizes the window. Cosnider the following simple HTML example: <!doctype html>
<html lang="en"> <head> <meta charset="utf-8" /> <title>Example</title> </head> <body> <a id="example-link" href="http://example.com/">Go to example page</a> <button id="example-button">Click me!</button> <div id="parent"> <button id="child">Click the child!</button> </div> <script> /* Our JavaScript code go be here. Note that the script tag must be at the end of the body. */ </script> </body>
</html> We can use the addEventListener to register an event listener on the button to set up a function that should be called if the button is clicked. The addEventListener function takes two arguments. The first argument is the event to listen to (which is 'click' in this case). The second argument is a function that takes the specific event and handles it. document.querySelector('#example-button').addEventListener('click', () => { console.log('Button was clicked!');
}); If you click the button, the text Button was clicked! will appear in the console. The addEventListener is a typical example of a higher-order function since it takes a function as one of its arguments. You can remove an event listener using the removeEventListener function: const clickFunction = () => { console.log('Button was clicked!');
}; document.querySelector('#example-button').addEventListener('click', clickFunction);
document.querySelector('#example-button').removeEventListener('click', clickFunction); The registered function can take the event object as an argument which is useful if you need to gather more information about the event: document.querySelector('#example-button').addEventListener('click', (e) => { console.log(e);
});

