Let's return to our imaginary (as of now) task application. A task will probably be something more than just a string. For example it might contain an ID, a title and a description. We could again store these in constants: const taskId = 1;
const taskTitle = 'Read the Next.js book';
const taskDescription = 'Read and understand the Next.js book.'; As you can probably guess, this will quickly become tedious (oh no, not this again). Objects to the rescue! These allow us to store name-value pairs inside a single variable. Here is how we might create a task object that contains all the information we want to know about a task: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}; Every such value is called a property . We can access properties using the dot notation or the square bracket notation. For example to access the title property of the task object, you would write task.title or task['title']. Try it out: console.log(task.id); // 1
console.log(task.title); // Read the Next.js book
console.log(task.description); // Read and understand the Next.js book.
console.log(task['id']); // 1
console.log(task['title']); // Read the Next.js book
console.log(task['description']); // Read and understand the Next.js book. Note that we will practically always use the dot notation. Remember how you accessed the length of an array using arr.length? You can do that because every array has a property called length that indicates the length of that array. Properties don't have to be primitive values. They can also be other objects. Generally speaking, you can arbitrarily nest objects and arrays. For example, here is how you can nest an object inside an object: const user = { name: 'John Doe', task: { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.', },
}; You can access the title property of the user.task object like this: console.log(user.task.title); // Read the Next.js book If you try to access a property that doesn't exist, the result will be undefined: console.log(task.date); // undefined Sometimes you want to explicitly indicate that a property may be absent. For example a person may not have a task assigned to them. You can write something like this: const person = { name: 'John Doe', task: undefined,
}; You could also use the null value: const person = { name: 'John Doe', task: null,
}; Whether to use undefined or null in this situation is largely convention. Throughout this book we will always use undefined. Just as with arrays, you can use the destructuring assignment when working with objects: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
};
const { id, title, description } = task; And just as with arrays, you can use the spread syntax: const taskWithAssignee = { assignee: 'John Doe', ...task,
};
console.log(taskWithAssignee); This will output: { "assignee": "John Doe", "id": 1, "title": "Read the Next.js book", "description": "Read and understand the Next.js book."
} Note that objects are more than just containers for values. We will return to this later.

