Consider our App function: function App() { return ( <div> <h1>Tasks</h1> <ul> <li>Read the Next.js book</li> <li>Write a website</li> </ul> </div> );
} While this might look like HTML, it is important to emphasize that this is absolutely not HTML. Instead this syntax is JSX, which is a syntax extension to JavaScript that can be transpiled to normal JavaScript. To be precise, the JSX will be transpiled to calls to the React.createElement function which will return regular JavaScript objects. The root object will be dynamically added to the DOM using this line of code: ReactDOM.createRoot(document.getElementById('root')!).render(<App />); The difference between JSX and HTML is not just a nitpick. For example, in JSX we can (and will) use and nest our own components exactly like we would use and nest HTML elements. Here is an example of a TaskList component rendered inside the App component: import ReactDOM from 'react-dom/client'; function App() { return <TaskList />;
} function TaskList() { return ( <div> <h1>Tasks</h1> <ul> <li>Read the Next.js book</li> <li>Write a website</li> </ul> </div> );
} ReactDOM.createRoot(document.getElementById('root')!).render(<App />); While possible, it's much more complicated (and relatively rare) to add your own custom tags in HTML. Additionally, you can include JavaScript expressions in JSX by wrapping them in curly braces {}. For example, this is a totally valid React component: function Example() { const x = 2; const y = 2; return <p>{x + y}</p>;
}

