JSX is great, but our current TaskList component is not. The main problem is that the data it represents is hardcoded into the component. We fix that by passing properties (props) to the component. This is simply a JavaScript object containing the data the component should render. In the case of the TaskList we simply want to pass an array of strings named tasks containing our - well - tasks. We can then use map to create a list item li for each element of that array: type TaskListProps = { tasks: string[],
}; function TaskList(props: TaskListProps) { return ( <ul> {props.tasks.map((task) => ( <li>{task}</li> ))} </ul> );
} This is already not too bad, but of course we want to take advantage of the latest and greatest JavaScript syntax there is. Writing props.tasks is annoying. This will become even more annoying when we have a lot of props. We can use object destructuring to alleviate this: function TaskList({ tasks }: TaskListProps) { return ( <ul> {tasks.map((item) => ( <li>{item}</li> ))} </ul> );
} You can hopefully see how all the concepts from the JavaScript and TypeScript chapters are coming together quite nicely. Excellent! We can use the new component like this: function App() { return ( <div> <h1>Tasks</h1> <TaskList tasks={['Read the Next.js book', 'Write a website']} /> </div> );
} Great. Note that there is a problem with the current implementation of our component. If you open your browser console, you will see an error "Warning: Each child in a list should have a unique 'key' prop.". The reason for that is that React needs a way to identify which items in a list have changed or have been added or removed. It does that by looking at the keys of the items. These basically give the elements a stable identity. Let's add IDs to the tasks and use the task IDs as keys for the component: function App() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <div> <h1>Tasks</h1> <TaskList tasks={tasks} /> </div> );
} function TaskList({ tasks }: TaskListProps) { return ( <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> );
} There is one final improvement we can make: The div element in App is pretty useless, since it only serves the purpose of wrapping the h1 and TaskList (since a component can only return a single JSX element). Luckily, there is a special component called a React fragment which allows us to wrap multiple JSX elements without showing up in the DOM later. You can create a fragment using the <></> syntax: function App() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <> <h1>Tasks</h1> <TaskList tasks={tasks} /> </> );
}

