Let's create a simple counter component. This component will have a button that increments a value: import * as React from 'react'; export default function Counter() { const [count, setCount] = React.useState(0); return ( <> <p>{count}</p> <button onClick={() => { setCount(count + 1); }} > Increment </button> </> );
} Try clicking the "Increment" button - it will increment the count by 1 each time you click it. This example is simple, but it still shows exactly how to use state in React. State is provided by the useState hook (a hook is basically just a special function). This hook returns an array with two elements - a state variable and a state setter function . The state variable (count in this case) will be the value that you want to remember. The state setter function (setCount in this case) can be used to update the state variable. The useState hook takes a single argument - the initial value of the state variable (which is 0 in this case). Note that we make use of array destructuring here (which you should remember from the JavaScript chapter): const [count, setCount] = React.useState(0); Alternatively we could have written: const countState = React.useState(0);
const count = countState[0];
const setCount = countState[1]; Please don't do that though - it will result in confusion since it's very unconventional to manually destructure the value returned from a hook.

