There is a common theme regarding state in React - a lot of beginners heavily overuse it. This is usually because they misunderstand the purpose of state and what it actually does. Before we give specific examples of when to and when not to use state, we want to reiterate two things we already discussed: First, state should only be used if your component needs to remember something. Second, state updates are expensive, because a state update will rerender your component. The corollary to these two things is that you should only use state when you absolutely need it , i.e. you should keep state to a minimum . First, you should never ever store static data in state. For example, this is completely unnecessary: export default function BadTaskList() { const tasks = React.useState([ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]); return ( <ul> {tasks.map((task) => ( <li key={task.id}>{task.summary}</li> ))} </ul> );
} Just use a local variable instead: export default function GoodTaskList() { const tasks = [ { id: 'TSK-1', title: 'Read the Next.js book', }, { id: 'TSK-2', title: 'Write a website', }, ]; return ( <ul> {tasks.map((task) => ( <li key={task.id}>{task.summary}</li> ))} </ul> );
} Of course, in this particular example, the tasks variable should really be passed as a prop to the component. We just want to show you when to and when not to use state here. Second, you should never store data in state that you can derive from other state (or props). For example, this is a bad idea: import * as React from 'react'; type Task = { id: string; title: string;
}; export default function TaskList() { const [tasks, setTasks] = React.useState<Task[]>([]); const [numTasks, setNumTasks] = React.useState(0); function handleSubmit(event) { event.preventDefault(); const taskId = event.currentTarget.taskId.value.trim(); const title = event.currentTarget.title.value.trim(); setTasks([ ...tasks, { id: taskId, title, }, ]); setNumTasks(numTasks + 1); } return ( <> <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> <p>You have {numTasks} tasks</p> <form onSubmit={handleSubmit}> <label htmlFor="taskId">Task ID:</label> <input type="text" id="taskId" /> <label htmlFor="title">Title:</label> <input type="text" id="title" /> <br /> <button type="submit">Add task</button> </form> </> );
} In this example, you really do need the tasks state (since you need to remember the tasks that have been added so far). However, you really don't need the numTasks state, because you can derive it from the value of the tasks state. After all, numTasks is simply equal to tasks.length. Here is how we can fix the component: import * as React from "react"; type Task = { id: string; title: string;
}; export default function TaskList() { const [tasks, setTasks] = React.useState<Task[]>([]); function handleSubmit(event) { event.preventDefault(); const taskId = event.currentTarget.taskId.value.trim(); const title = event.currentTarget.title.value.trim(); setTasks([ ...tasks, { id: taskId, title, }, ]); } return ( <> <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> <p>You have {tasks.length} tasks</p> <form onSubmit={handleSubmit}> <label htmlFor="taskId">Task ID:</label> <input type="text" id="taskId" /> <label htmlFor="title">Title:</label> <input type="text" id="title" /> <br /> <button type="submit">Add task</button> </form> </> );
}

25.body:
Quite often, we need to make decisions in our programs. Let's say we want to display a fancy message when a bunch of tasks are completed. This is a decision: If all the tasks are completed, then we want to display a message. Put generally: If a condition holds (is true), then we want to do something. Conveniently, the language keyword that allows us to accomplish this is called if: const completed = true;
if (completed) { console.log('Hooray, you completed all your tasks!');
} This would print: Hooray, you completed all your tasks! The general form of an if statement looks like this: if (condition) { statements;
} If condition is true, then the statements inside the curly braces will be executed. If condition is false, nothing will happen. Note that technically it suffices if the condition is truthy or falsy . We will ignore this detail for now and return to it in a second. The simplest condition is a boolean variable. However, nothing prevents us from writing more complex conditions. For example, let's say we have a list of uncompleted tasks (conveniently) named tasks. Then we could check that all tasks have been completed by checking whether tasks is empty (i.e. the length of tasks is zero): if (tasks.length === 0) { console.log('Hooray, you completed all your tasks!');
} Sometimes you need to do something in one case and something else in another case. The (also conveniently named) else keyword allows you to accomplish exactly that: if (tasks.length === 0) { console.log('Hooray, you completed all your tasks!');
} else { console.log('You still have some tasks to complete.');
} The general form of an if...else statement looks like this: if (condition) { statements1;
} else { statements2;
} If condition is true, the statements corresponding to statements1 will be executed (i.e. the statements inside the curly braces after the if). If condition is false, the statements corresponding to statements2 will be executed (i.e. the statements inside the curly braces after the else). Note that there may be multiple statements between the curly braces. This is totally valid: if (tasks.length === 0) { console.log('Hooray, you completed all your tasks!'); console.log('Congratulations!'); console.log('No really, you are amazing!');
} else { console.log('You still have some tasks to complete.'); console.log('Do not despair!');
} Assuming tasks has a length of 0 this will print: Hooray, you completed all your tasks!
Congratulations!
No really, you are amazing! Sometimes you need to handle more than two cases. Since JavaScript was fresh out of keywords at this point, they allowed you to do so using else if: if (tasks.length === 0) { console.log('Hooray, you completed all your tasks!');
} else if (tasks.length === 1) { console.log('Only one task left! Go! Go! Go!');
} else { console.log('You still have some tasks to complete.');
} The general form of an if...else if...else statement looks like this: if (condition1) { statements1;
} else if (condition2) { statements2;
} /*possibly more else ifs*/ else if (conditionN) { statementsN;
} else { statementsElse;
} Here all the conditions will be checked one after another. As soon as a condition is true, the corresponding statements will be executed. If no condition matches, the statements corresponding to statementsElse will be executed. You can have any number of else if statements. For example, this is valid: if (tasks.length === 0) { console.log('Hooray, you completed all your tasks!');
} else if (tasks.length === 1) { console.log('Only one task left! Go! Go! Go!');
} else if (tasks.length === 2) { console.log('You have two tasks to do.');
} else if (tasks.length === 3) { console.log('There are three tasks left.');
} else { console.log('You still have some tasks to complete.');
} Note that the else block is not required. If it's missing and none of the conditions are true, nothing will happen.

