Here is the simplest possible example for a useEffect hook. This hook takes a function which is executed when the component is first rendered or rerendered: import * as React from 'react'; export default function ExampleComponent() { React.useEffect(() => { console.log('Effect runs'); }); return <div>Hello, World!</div>;
} If you display this component on a page, here is what you will see in the console: Effect runs Let's add some state to the component so that we can see what happens when the component rerenders: import * as React from 'react'; export default function ExampleCounter() { const [count, setCount] = React.useState(0); React.useEffect(() => { console.log(`Effect runs (currently count=${count})`); }); return ( <> <p>{count}</p> <button onClick={() => { setCount(count + 1); }} > Increment </button> </> );
} Open the page containing the component again and you will see the following log: Effect runs (currently count=0) Now click the button a few times - you will see that on each rerender the effect is executed: Effect runs (currently count=1)
Effect runs (currently count=2)
Effect runs (currently count=3)
Effect runs (currently count=4) Additionally we can return a cleanup function, which will run when the component is destroyed ( unmounted ), and before every rerun of the useEffect. We will examine when exactly an useEffect reruns in the next section . Consider this example: import * as React from 'react'; export default function ExampleComponent() { React.useEffect(() => { console.log('Effect runs'); return () => { console.log('Component destroyed'); }; }); return <div>Hello, World!</div>;
} If the component is destroyed (for example, because you refresh the page or navigate away from the current page), you will see the following log: Component destroyed Usually you would use the cleanup function to do some cleanup ( no way ). For example, if you've connected to an external system, here is were you would disconnect.

