The useEffect hook also takes a second argument - a dependency array . This allows you to specify that the effect should run only if a particular value changes. Consider this (slightly constructed) example: import * as React from 'react'; export default function Counter() { const [firstCount, setFirstCount] = React.useState(0); const [secondCount, setSecondCount] = React.useState(0); React.useEffect(() => { console.log(`Current counts: firstCount=${firstCount}, secondCount=${secondCount}`); }, [firstCount]); return ( <div> <p>{`Current counts: firstCount=${firstCount}, secondCount=${secondCount}`}</p> <button onClick={() => setFirstCount(firstCount + 1)}>Increment first count</button> <button onClick={() => setSecondCount(secondCount + 1)}>Increment second count</button> </div> );
} As usual, the effect runs on the initial render: Current counts: firstCount=0, secondCount=0 If you click the "Increment first count" button, you will see that the effect runs again: Current counts: firstCount=1, secondCount=0
Current counts: firstCount=2, secondCount=0
Current counts: firstCount=3, secondCount=0
Current counts: firstCount=4, secondCount=0 However, if you click the "Increment second count" button, you will see that the effect doesn't run (and nothing is logged to the console). This is because firstCount is in the dependency array, but secondCount isn't. Therefore, an update to firstCount (via the setFirstCount setter function) will trigger the effect. But an update to secondCount (via the setSecondCount setter function) won't. If you want to trigger the effect when secondCount is updated, you will need to add secondCount to the dependency array: React.useEffect(() => { console.log(`Current counts: firstCount=${firstCount}, secondCount=${secondCount}`);
}, [firstCount, secondCount]); Note that if the dependency array is empty, the effect will run only once - when the component is first rendered. This directly follows from the explanation above - an empty dependency array contains no values that would trigger the effect again. Consider this example: import * as React from 'react'; export default function Counter() { const [firstCount, setFirstCount] = React.useState(0); const [secondCount, setSecondCount] = React.useState(0); React.useEffect(() => { console.log(`Current counts: firstCount=${firstCount}, secondCount=${secondCount}`); }, []); return ( <div> <p>{`Current counts: firstCount=${firstCount}, secondCount=${secondCount}`}</p> <button onClick={() => setFirstCount(firstCount + 1)}>Increment first count</button> <button onClick={() => setSecondCount(secondCount + 1)}>Increment second count</button> </div> );
} The effect will run on the initial render: Current counts: firstCount=0, secondCount=0 But it won't run again, no matter how often you click the buttons. Here is a bonus tip regarding effects: You should always explicitly specify the dependency array . Remember, if you don't specify the dependency array, the effect will rerun on every render, which is rarely the desired behaviour. In fact this can result in catastrophic behaviour, like in the following example: export default function ExampleComponent() { const [count, setCount] = React.useState(0); React.useEffect(() => { setCount(count + 1); }); return ( <div> <h1>Example Component</h1> <p>Count: {count}</p> </div> );
} If you run this, you will see that the counter just keeps incrementing in an infinite loop. This is because, the effect calls setCount, which will trigger a rerender, which will trigger the effect again, which will call setCount etc. React is actually smart enough to realize the problem and will log the following warning to the console: Maximum update depth exceeded.
This can happen when a component calls setState inside useEffect,
but useEffect either doesn't have a dependency array,
or one of the dependencies changes on every render.

