Just like with state, beginners tend to heavily overuse effects. Remember: Effects are only needed if you need to synchronize with an external system . You should not need an effect in any other scenario. Effects are definitely not needed if you need update some state based on props and other state. Something like this is completely unneccessary: import * as React from 'react'; type Task = { id: string; title: string;
}; export default function TaskList() { const [tasks, setTasks] = React.useState<Task[]>([]); const [numTasks, setNumTasks] = React.useState(0); // This is a really bad idea React.useEffect(() => { setNumTasks(tasks + 1); }, [tasks]) function handleSubmit(event) { event.preventDefault(); const taskId = event.currentTarget.taskId.value.trim(); const title = event.currentTarget.title.value.trim(); setTasks([ ...tasks, { id: taskId, title, }, ]); } return ( <> <ul> {tasks.map((item) => ( <li key={item.id}>{item.title}</li> ))} </ul> <p>You have {numTasks} tasks</p> <form onSubmit={handleSubmit}> <label htmlFor="taskId">Task ID:</label> <input type="text" id="taskId" /> <label htmlFor="title">Title:</label> <input type="text" id="title" /> <br /> <button type="submit">Add task</button> </form> </> );
} Instead you should simply calculate the depending value during rendering (like we discussed in the previous section). Similarly, you don't need effects when you want to reset or adjust some state based on a prop change. In fact, these days some guidelines recommend to not use an effect even for fetching data. This is because if you fetch data inside an effect in more complex scenarios, you need to think about cleanup functions, race conditions etc. This why most frameworks that build on top of React (like Next.js) usually provide better data fetching mechanisms than fetching data in effects.

