Note that the condition does not necessary have to be a boolean as JavaScript will automatically evaluate non-boolean values as "truthy" or "falsy" in boolean contexts. For example you could write something like this: if (1) { console.log('1 is truthy.');
} else { console.log('1 is falsy.');
