The regular for loop consists of three expressions. The first expression is the initialization expression and typically initializes some kind of counter. The second expression is the condition expression and typically checks for some condition. If the condition is true the statement(s) in the loop body execute, otherwise the loop terminates. Finally the third expression (sometimes called afterthough expression ) is evaluated at the end of each loop iteration and typically advances the counter. As usual a code example says more than a thousand words: for (let i = 0; i < 3; i++) { console.log(i);
} This will log the following lines to the console: 0
1
2 You can use regular for loops to iterate over arrays: const tasks = ['Task 1', 'Task 2', 'Task 3']; for (let i = 0; i < tasks.length; i++) { console.log(tasks[i]);
} This will log the following lines to the console: Task 1
Task 2
Task 3 However we will soon learn better ways to perform array iteration.

