Next, we need to set up Drizzle. Here we will simply follow the steps from the Drizzle chapter. Install Drizzle and dotenv: pnpm add drizzle-orm postgres dotenv
pnpm add --save-dev tsx drizzle-kit Create a new directory called db. This is where our database-related files will go. Remember that we specify all paths relative to src, i.e. you need to create the db directory in src. Now create a directory db/migrations to store the migrations. Create a file db/drizzle.config.ts: import { defineConfig } from 'drizzle-kit'; export default defineConfig({ dialect: 'postgresql', schema: './src/db/schema.ts', out: './src/db/migrations', dbCredentials: { url: process.env.DATABASE_URL!, },
}); Next we create a file db/migrate.ts: import { drizzle } from 'drizzle-orm/postgres-js';
import postgres from 'postgres';
import dotenv from 'dotenv';
import { migrate } from 'drizzle-orm/postgres-js/migrator'; dotenv.config({ path: ['.env.local', '.env'] }); const databaseURI = process.env.DATABASE_URL; if (databaseURI === undefined) { console.log('You need to provide the database URI'); process.exit(0);
} const client = postgres(databaseURI, { max: 1 });
const db = drizzle(client); async function runMigrations() { await migrate(db, { migrationsFolder: './src/db/migrations' }); await client.end();
} runMigrations().then(console.log).catch(console.error); Finally, let's create the initial schema at db/schema.ts: import { pgTable, serial, text, timestamp } from 'drizzle-orm/pg-core'; export const projectTable = pgTable('project', { id: serial('id').primaryKey(), userId: text('user_id').notNull(), name: text('name').notNull(), createdAt: timestamp('created_at').defaultNow().notNull(),
}); To simplify migrations, we will add the following scripts to package.json: { "scripts": { // other scripts "db:generate": "pnpm drizzle-kit generate --config=src/db/drizzle.config.ts", "db:migrate": "pnpm tsx src/db/migrate.ts" }
} Now run pnpm db:generate to generate the migration. Inspect the migration (which would be something like db/migrations/0000_curious_vanisher-sql) and make sure that it contains the right content: CREATE TABLE IF NOT EXISTS "project" ( "id" serial PRIMARY KEY NOT NULL, "user_id" text NOT NULL, "name" text NOT NULL, "created_at" timestamp DEFAULT now() NOT NULL
); Run pnpm db:migrate to apply the migration to the database. Verify that your database contains a project table with the right columns. Finally, we create the db/index.ts file which exports the db object to allow other files to call database functions: import { drizzle } from 'drizzle-orm/postgres-js';
import postgres from 'postgres'; const databaseURL = process.env.DATABASE_URL!; const client = postgres(databaseURL);
export const db = drizzle(client); Yes, this subsection was essentially a repeat of things you already learned in the Drizzle chapter.

