Sometimes it can be useful to pass an arbitrary number of arguments to a function. This can be done via rest parameters : function sum(...args) { let result = 0; for (let i = 0; i < args.length; i++) { result += args[i]; } return result;
} console.log(sum()); // 0
console.log(sum(1)); // 1
console.log(sum(1, 2)); // 3
console.log(sum(1, 2, 3)); // 6

