Despite the fact that using typeof on function will result in function, functions are really just objects. This means that we can assign functions as variables, pass them to other functions as arguments and do all the other neat things we can do with primitives and objects. For example we could assign the square function to a variable: const square = function square(num) { return num * num;
}; We could then call this like a regular function by doing e.g. square(3). This is called a function expression . Note that the function may be anonymous (i.e. nameless): const square = function (num) { return num * num;
}; The syntax for calling such a function is still the same, e.g. we would still write square(3) to call the function.

