An instance method (often just method for short) is a function which is a property of an object. const greeter = { greet: function () { console.log('Hello, world!'); },
}; You can call a method like this: greeter.greet(); // Hello, world! Methods can refer to the properties of an object using the this keyword which is simply a reference to the current object: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.', longDescription: function () { return `${this.title}(ID = ${this.id}): ${this.description}`; },
}; You can call the method by writing task.longDescription(). This would output: Read the Next.js book(ID = 1): Read and understand the MERN book. Methods can also change properties of objects. We will not dwell on methods for too long, since we will not use them all that often as this would lead to a ghastly thing called Object-Oriented Programming (OOP for short). Instead we want you to think functionally , which is what the next section will be about. Inevitable disclaimer for certain Java/C#/... people: The sentence about OOP was a joke and used correctly, OOP has its merits. We just wanted to be funny. We're very sorry about that and will now perform the appropriate penance procedure.

