The scope of a variable is the part of the program in which it can be referenced. There are three scopes that are important right now - the global scope , the function scope and the block scope . Later we will also learn about the module scope. Consider the following script: let inGlobalScope = 0; function f() { let inFunctionScope = 1; if (true) { let inBlockScope = 2; }
} The variable inGlobalScope is in global scope and can be accessed by the entire script. For example all of these console.log calls will correctly print the value of the variable: let inGlobalScope = 0; function f() { let inFunctionScope = 1; if (true) { let inBlockScope = 2; console.log(inGlobalScope); } console.log(inGlobalScope);
} f();
