The try...catch statement specifies a block of statements to execute "normally" and a block to execute if the "normal" block throws an exception. The normal block is contained in a try block while the "exception" block is contained in a catch block. If any statement in the try throws an exception, code execution jumps to the catch block immediately - the rest of the try block is ignored: function divide(x, y) { if (y === 0) { throw new Error('Division by 0 is a bad idea'); } return x / y;
} try { console.log('try block'); console.log(divide(3, 0));
} catch (e) { console.log('catch block');
} This will log: try block
catch block Note that if the try block doesn't throw an exception, the catch block is never executed. Consider this example: function divide(x, y) { if (y === 0) { throw new Error('Division by 0 is a bad idea'); } return x / y;
} try { console.log('try block'); console.log(divide(3, 1));
} catch (e) { console.log('catch block');
} This will log: try block
3

