The sort method can be used to sort the elements of an array: const tasks = ['Task 2', 'Task 1', 'Task 3'];
tasks.sort();
console.log(tasks); // [ 'Task 1', 'Task 2', 'Task 3' ] The default sort order is ascending and elements are sorted by converting them to strings and then sorting the strings lexicographically. However this may not be what you want, especially when you're trying to sort numbers: const numbers = [2, 8, 4, 12, 6, 10];
numbers.sort();
console.log(numbers); // [ 10, 12, 2, 4, 6, 8 ] If you want to sort differently, you need to specify a comparison function compareFn. This takes two arguments a and b and returns a number whose sign indicates the relative order of the elements in the sorted array. If compareFn(a, b) is greater than 0 then a should be sorted after b. If compareFn(a, b) is smaller than 0 then a should be sorted before b. If compareFn(a, b) is equal than 0 then the original order of a and b should be kept. For example, if you want to sort numbers in an ascending manner, you should specify the comparison function (x, y) => x - y. After all, if x - y is greater than 0 then y will be sorted after x (which is exactly what you want). Similarly, if x - y is smaller than 0 then y will be sorted before x (which is again what you want). const numbers = [2, 8, 4, 12, 6, 10];
numbers.sort((x, y) => x - y);
console.log(numbers); // [ 2, 4, 6, 8, 10, 12 ] If you would want to sort numbers in a descending manner, you would need to change your comparison function to (x, y) => y - x: const numbers = [2, 8, 4, 12, 6, 10];
numbers.sort((x, y) => y - x);
console.log(numbers); // [ 12, 10, 8, 6, 4, 2 ] You can use the comparison function to sort arbitrary objects as well. For example, here is how you could sort the tasks array by the timeLogged: tasks.sort((task1, task2) => task1.timeLogged - task2.timeLogged);

