We often need to execute long-running operations (especially in web development). For example, we might need to fetch a resource from a server or request camera access from a user. In the first case, we need to wait for all the network packets to arrive, which might take a long time depending on your network connectivity. In the second case, we need to wait for the user to grant us access to the resource we require. We want do be able to do this without "blocking". To accomplish this, we need to break up with our current "synchronous" programming model where statements are executed one after another. Consider the following example: function getTask(taskId) { return `Task with ID ${taskId}`;
} const task = getTask(0);
console.log(task); The getTask function is a synchronous function . This means that the calling code (i.e. const task = getTask(0)) has to wait until getTask has finished its work to continue. That is all fine and dandy here, given that getTask should (hopefully) complete its "work" very fast. But what if getTask represents a long-running operation, like retrieving a task from a server? function getTask(taskId) { return retrieveTaskFromServer(taskId);
} const task = getTask(0);
console.log(task); Now the calling code has to wait for the request to complete before it can do anything else. This will become a huge problem in the browser environment, given that synchronous functions like getTask are "blocking". Therefore as long as getTask is executing, no other code will be able to run, including code that handles user events. This means that the user will not be able to select text, click buttons or do anything else with the website, i.e. the website "hangs". Of course we want to avoid such a nuisance since this will result in the much dreaded negative user experience . If you ever clicked a button on a website and everything just freezes for three seconds, this is probably the result of synchronous function being used to handle a long-running task. We need a mechanism to start a (potentially) long-running task and still be able to do other things (like respond to user events) instead of blocking until the task is finished. Once the task is completed, our program needs to be notified with result. Here is a step-by-step breakdown of what we want to accomplish: Call a function that starts a long-running operation. The function should return immediately, so that the "main" program is able to do something else. Once the long-running operation is completed, the "main" program should be notified. In case you think to yourself right now "this all sounds very complicated and when do I need long-running tasks anyway, maybe I'll skip this section" - don't. Practically every project you'll write (essentially when doing web development) will contain asynchronous code.

