The above code is completely missing one very important point - error handling. Most long-running operations (especially those that involve external resources like a network or a file system) can fail. For example fetch will fail (and fetchPromise will thus be rejected) if your network is down. You can test this - turn off your network and execute the above code again. You will get a weird error that looks approximately like this: TypeError: fetch failed at Object.fetch (node:internal/deps/undici/undici:11457:11) at process.processTicksAndRejections (node:internal/process/task_queues:95:5) { cause: Error: getaddrinfo EAI_AGAIN jsonplaceholder.typicode.com at GetAddrInfoReqWrap.onlookup [as oncomplete] (node:dns:107:26) { errno: -3001, code: 'EAI_AGAIN', syscall: 'getaddrinfo', hostname: 'jsonplaceholder.typicode.com' }
} Additionally, we will usually want to throw an error if fetch itself succeeds, but the status of the response is "not ok" (we will return to this in more detail in the section about HTTP): const url = 'https://jsonplaceholder.typicode.com/todos/1';
fetch(url) .then((response) => { if (!response.ok) { throw new Error(`Request failed with status ${response.status}`); } return response.json(); }) .then((json) => console.log(json)); We want to be able to catch all the errors that can happen and log an error message to the console. The Promise API gives us the appropriately named catch method to accomplish this. We simply add a catch handler to the end of our promise chain - it will be called when any of the asynchronous operations fail: const url = 'https://jsonplaceholder.typicode.com/todos/1';
