The example above showcased the use of named exports . Here each function is referred by its name when exporting and the same name is used when importing. You can export multiple functions when performing named exports. You can create a named export by prefixing a function with the export keyword: export function getGreeting(name) { return `Hello ${name}`;
} export function greet(name) { return `Hello ${name}`;
} Alternatively you can use an export list : function getGreeting(name) { return `Hello ${name}`;
