} export { getImportantGreeting as getGreeting }; If you need to import multiple functions, you can do that as well: import { getGreeting, greet } from './greet.js'; You can also rename imports: import { getGreeting, greet as sayHello } from './greet.js'; This is useful if you have several modules that export functions with a same name. For example if you had a module greet that exports the function greet and a module other-greet that exports the function greet as well, you would run into problems if you just tried to import greet: import { greet } from './greet.js';
