The heart of any JavaScript package is the package.json file. This should contain a JSON with important information about the package like the name and version. Here is the minimal package.json: { "name": "example-package", "version": "1.0.0"
} The version field follows a convention called SemVer (short for Semantic Versioning). This defines that any version of a package (or library) should have the format MAJOR.MINOR.PATCH where MAJOR, MINOR and PATCH are non-negative integers. Whenever you update a package, you should make a change to the package version. If you make backward incompatible API changes, you should increment the MAJOR number and reset the other numbers. For example if you release a big update of a package with the version 1.32.2 where you change a lot of function signatures you should update the version to 2.0.0. If you add functionality in a backward compatible manner, you should increment the MINOR number and reset the PATCH number. For example if you release an update of a package with the version 1.32.2 and you add a couple of new functions you should update the version to 1.33.0. If you just make backward compatible bug fixes, you should increment the PATCH number. For example if you release an update of a package with the version 1.32.2 and you fix a bug in one of your functions you should update the version to 1.32.3. The main field can be used to specify the entry point of your package. This is the primary file that will be loaded if your package is required by a Node.js application. Since we use ESM for our modules, we will also need to specify "type": "module" in our package.json. For example, if we want index.js to be the entry point of our package, we would need to specify the following package.json file: { "name": "example-package", "version": "1.0.0", "type": "module", "main": "index.js"
} Next let's create an ESM module index.js: export function greet(name) { console.log(`Hello ${name}`);
} You can now use the greet function of your package in other packages that import it. We will show an example of this in a second.

