Consider a function that filters tasks based on their status, user ID and days until deadline. We could write it like this: function filterTasks(tasks, status, userId, daysUntilDeadline) { const filteredTasks = []; for (let i = 0; i < tasks.length; i++) { if (tasks[i].status === status) { if (tasks[i].assignee === userId) { const deadline = new Date(tasks[i].deadline); const today = new Date(); const futureDate = new Date( today.getFullYear(), today.getMonth(), today.getDate() + daysUntilDeadline, ); if (deadline <= futureDate) { filteredTasks.push(tasks[i]); } } } } return filteredTasks;
} This looks supremely ugly and hard to read due to the deep nesting of the code. Luckily, this is pretty easy to fix using two very specific tricks: First, we can extract the body of the for loop into a helper function: function taskMatchesCriteria(task, status, userId, daysUntilDeadline) { if (task.status === status) { if (task.assignee === userId) { const today = new Date(); const futureDate = new Date( today.getFullYear(), today.getMonth(), today.getDate() + daysUntilDeadline, ); if (task.deadline <= futureDate) { return true; } } } return false;
} function filterTasks(tasks, status, userId, daysUntilDeadline) { return tasks.filter((task) => taskMatchesCriteria(task, status, userId, daysUntilDeadline));
} One level of nesting gone already. For the second trick, we can simplify the taskMatchesCriteria by either flattening the conditions or using early exits. Flattening the condition is simple: function taskMatchesCriteria(task, status, userId, daysUntilDeadline) { const today = new Date(); const futureDate = new Date( today.getFullYear(), today.getMonth(), today.getDate() + daysUntilDeadline, ); return task.status === status && task.assignee === userId && task.deadline <= futureDate;
} However sometimes this is not possible or leads to a very complex logical expression. In this case we can check the "inverted" conditions one by one and "early exit" if something doesn't match: function taskMatchesCriteria(task, status, userId, daysUntilDeadline) { // Early exit number 1 if (task.status !== status) { return false; } // Early exit number 2 if (task.assignee !== userId) { return false; } const today = new Date(); const futureDate = new Date( today.getFullYear(), today.getMonth(), today.getDate() + daysUntilDeadline, ); return task.deadline <= futureDate;
} The general takeaway is this: Flatten deeply nested code by extracting helper functions and simplifying conditions.

