One of the big differences between junior programmers and more senior developers is that juniors tend to ignore edge cases and just focus on the "happy path". Consider this piece of code: const task = tasks.find((task) => task.id === taskId);
task.assignee = userId;
task.status = 'inprogress'; This has a big problem: What if taskId is not present in the IDs of tasks? Then task will be undefined and our program will crash when trying to assign the assignee property to task. This edge case needs to be handled: const task = tasks.find((task) => task.id === taskId);
if (task === undefined) { console.log(`Task with ID ${taskId} not present`);
} else { task.assignee = userId; task.status = 'inprogress';
} Example operations which can lead to problems if you don't consider edge cases are: division (because you could divide by zero) processing strings (because strings could be empty or have whitespace at the beginning or the end) extracting elements from arrays by a condition (because there might be no elements present that match the condition) processing user input (because users can and will type arbitrary garbage into your application) And of course every time you work with an external resource (like fetching something), you need to handle potential errors. The main takeaway from this sections is: Don't be satisfied by just writing the happy path. Think about the edge cases.

