Consider the following scenario. You have a JavaScript function showTask(task) which takes a task object and displays the task in a UI (or in the console). Let's say your task object looks like this: const task = { id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}; Can you pass this object to showTask? Well, you can't really tell. Maybe the showTask function expects an object that has id, title, description and status fields. The only way to find out if your task object is a valid input for showTask is to - well - actually pass it and find out. This is obviously not the ideal workflow (especially if you happen to find out that your object lacked some important properties in production ). Additionally, if the author of the showTask function changes his function to expect additional properties on the task object, they would now have to check all the invocations of showTask to verify that they didn't accidentally break something. This is where TypeScript comes in. With TypeScript we would be able to statically type the function by adding type annotations like this: type Task = { id: number; title: string; description: string;
}; function showTask(task: Task) { // Implementation here
} Now we know exactly what kind of object showTask expects. An object that is passed to the function must have an id property which is a number, a title property which is a string and a description property which is also a string. For example we could call the function like this: showTask({ id: 1, title: 'Read the Next.js book', description: 'Read and understand the Next.js book.',
}); If we would pass an object that lacks some of the expected properties and run type checks (more on that later) we will get an error long before the bad code can make it anywhere near production. Even better - your editor will be able to show you that you might have a problem during development: showTask({ id: 1, title: 'Read the Next.js book',
});
// Most editors will now show a squiggly red line somewhere around here and
// politely scream at you that the object is missing the description property. Better still (TypeScript just keeps giving), you now get autocompletion - editors will show possible suggestions for the property names your object should have while you are typing . This saves an enormous amount of time and effort when writing code. To summarize, using TypeScript massively enhances your developer workflow which is why nowadays most large projects use TypeScript instead of vanilla JavaScript.
